import DTT_CHATBOT_HRS:Tools:*;

class RecruitAuthoriseBot implements DTT_CHATBOT_HRS:Tools:Template
   method RecruitAuthoriseBot();

   method OnRequest(&message As Message) Returns Message;
   method OnError(&request As Message) Returns string;

private
   instance string &UserID;
   instance string &EmplID;
   instance number &EmplRcd;
   instance boolean &AuthenticateResponse;
   instance string &AuthToken;

end-class;

method RecruitAuthoriseBot
   /* Setup the response document */
   %Super = create DTT_CHATBOT_HRS:Tools:Template();

   %This.ResponseMsg = CreateMessage(Operation.POIT_CHATBOT_AUTH_HRS_GET, %IntBroker_Response);
   %This.ResponseDoc = %This.ResponseMsg.GetDocument();
   %This.ResponseComp = %This.ResponseDoc.DocumentElement;

end-method;

method OnRequest
   /+ &message as Message +/
   /+ Returns Message +/
   /+ Extends/implements DTT_CHATBOT_HRS:Tools:Template.OnRequest +/

   Local Message &request, &response;
   Local Document &resp_doc, &UriDoc;
   Local string &Password, &strFirstName, &strLastName;
   Local number &nbrHRSCheckID;
   Local Record &rAppNameRecord;


   /* Get the user authentication details from the input message */
   %This.RequestMsg = &message;
   %This.RequestURIDoc = %This.RequestMsg.GetURIDocument();
   %This.RequestComp = %This.RequestURIDoc.DocumentElement;

   &UserID = %This.RequestComp.GetPropertyByName("USERID").value;
   &Password = %This.RequestComp.GetPropertyByName("PASSWORD").value;

   /* Authenticate */
   SQLExec(SQL.POIT_AUTH_HRS_APP_EMAIL, &UserID, &Password, &nbrHRSCheckID);

   If None(&nbrHRSCheckID) Then
      %This.ResponseComp.GetPropertyByName("SUCCESS").value = False;
      %This.ResponseComp.GetPropertyByName("MESSAGE").value = "Unable to verify your details";
   Else
      %This.ResponseComp.GetPropertyByName("SUCCESS").value = True;
      %This.ResponseComp.GetPropertyByName("PERSONID").value = &nbrHRSCheckID;

      /* Get personal details */
      &rAppNameRecord = CreateRecord(Record.HRS_APP_NAMES);

      &rAppNameRecord.HRS_PERSON_ID.Value = &nbrHRSCheckID;
      &rAppNameRecord.NAME_TYPE.Value = "PRI";

      If &rAppNameRecord.SelectByKey() Then
         If All(&rAppNameRecord.FIRST_NAME.Value) Then
            &strFirstName = &rAppNameRecord.FIRST_NAME.Value;
            &strLastName = &rAppNameRecord.LAST_NAME.Value;
         End-If;
      End-If;

      %This.ResponseComp.GetPropertyByName("FIRSTNAME").value = &strFirstName;
      %This.ResponseComp.GetPropertyByName("LASTNAME").value = &strLastName;
   End-If;


   /* Set the status and messages flags as necessary */
   Return %This.ResponseMsg;

end-method;

method OnError
   /+ &request as Message +/
   /+ Returns String +/
   /+ Extends/implements DTT_CHATBOT_HRS:Tools:Template.OnError +/
   Return "";
end-method;

/**
 * This class is used to forecast an absence take balance which will allow the following:
 *  - Fetch based upon a valid absence take for the given employee
 *
 *  Author: Jay Anthony
 *  Date: 1 Aug 2018
 *  Project: Chatbot HCM
 */
import DTT_CHATBOT_HRS:Tools:*;

class CheckApplications implements DTT_CHATBOT_HRS:Tools:Template
   method CheckApplications();
   method OnRequest(&message As Message) Returns Message;
   method OnError(&request As Message) Returns string;

   /* Validate Employees*/
   method ValidatePerson() Returns boolean;

private
   instance Collection &JobCol, &IntCol;
   instance Compound &JobCmp, &IntCmp;

end-class;

method CheckApplications

   /* Setup the response document */
   %Super = create DTT_CHATBOT_HRS:Tools:Template();

   %This.ResponseMsg = CreateMessage(Operation.DTT_CHATBOT_HRS_STATUS_GET, %IntBroker_Response);
   %This.ResponseDoc = %This.ResponseMsg.GetDocument();
   %This.ResponseComp = %This.ResponseDoc.DocumentElement;

end-method;


method OnRequest
   /+ &message as Message +/
   /+ Returns Message +/
   /+ Extends/implements DTT_CHATBOT_HRS:Tools:Template.OnRequest +/

   Local Message &request, &response;
   Local Document &resp_doc, &UriDoc;
   Local string &xml, &processInstanceId;
   Local string &strPersonID;
   Local XmlDoc &xmlout, &reqXml;
   Local Compound &com, &resp_com, &com_bal;
   Local Collection &colBals;

   Local SQL &sqlJobs, &sqlInt;

   Local number &int;
   Local boolean &rtn;

   /*read URIDoc XML*/
   %This.RequestMsg = &message;

   If &message.HTTPMethod = %IntBroker_HTTP_GET Then
      %This.RequestURIDoc = %This.RequestMsg.GetURIDocument();
   End-If;
   If &message.HTTPMethod = %IntBroker_HTTP_POST Then
      %This.RequestURIDoc = %This.RequestMsg.GetDocument();
      Local string &jsonString = %This.RequestURIDoc.GenJsonString();
      Local boolean &blnCHeck = %This.RequestURIDoc.ParseJsonString(&jsonString, True);
   End-If;

   %This.RequestComp = %This.RequestURIDoc.DocumentElement;

   /* Get the emploeye ID */
   %This.PersonID = %This.RequestComp.GetPropertyByName("PERSONID").value;

   /* Lets validate the data we have set so far */
   If %This.ValidatePerson() Then
      /* Return the current delegation transcations for this member */
      Local number &a, &i, &j;
      Local string &JobID, &Status, &StatusPhase, &Title, &ContactName, &ContactEmail, &ContactPhone, &strIntID, &strFirstName, &strLastName;
      Local string &strInterviewers;
      Local datetime &Submitted;
      Local date &OpenDate, &CloseDate;
      Local number &counter, &intInterviewID, &counterInt, &HRS_INT_ID, &intRcmntID;
      Local Rowset &rsJobs, &rsInv, &rsInterviewer;
      Local Record &rcdJob, &rcdInv, &rcdInterviewer;

      &counter = 1;

      &strPersonID = %This.PersonID;

      &JobCol = %This.ResponseComp.GetPropertyByName("JOBS");
      &IntCol = %This.ResponseComp.GetPropertyByName("INTERVIEWS");

      &rsJobs = CreateRowset(Record.POIT_HRS_APP_VW);
      &rsJobs.Fill("WHERE FILL.HRS_PERSON_ID = :1", &strPersonID);

      If &rsJobs.ActiveRowCount > 0 And
            All(&rsJobs(1).GetRecord(Record.POIT_HRS_APP_VW).GetField(Field.HRS_PERSON_ID).Value) Then
         For &a = 1 To &rsJobs.ActiveRowCount
            &rcdJob = &rsJobs.GetRow(&a).GetRecord(Record.POIT_HRS_APP_VW);

            &JobID = &rcdJob.GetField(Field.HRS_JOB_OPENING_ID).Value;
            &Title = &rcdJob.GetField(Field.POSTING_TITLE).Value;
            &Status = &rcdJob.GetField(Field.DESCR).Value;
            &StatusPhase = &rcdJob.GetField(Field.STATUS_FIELD).Value;
            &Submitted = &rcdJob.GetField(Field.HRS_SUBMITTED_DTTM).Value;
            &OpenDate = &rcdJob.GetField(Field.OPEN_DT).Value;
            &CloseDate = &rcdJob.GetField(Field.CLOSE_DT).Value;
            &ContactName = &rcdJob.GetField(Field.NAME).Value;
            &ContactEmail = &rcdJob.GetField(Field.EMAIL_ADDR).Value;
            &ContactPhone = &rcdJob.GetField(Field.PHONE).Value;

            /* Get all current delegation transactions and construct response */
            &JobCmp = &JobCol.CreateItem();

            &JobCmp.GetPropertyByName("STATUS").value = &StatusPhase;
            &JobCmp.GetPropertyByName("ID").value = &JobID;
            &JobCmp.GetPropertyByName("JOBTITLE").value = &Title;
            &JobCmp.GetPropertyByName("SUBMITDTTM").value = &Submitted;
            &JobCmp.GetPropertyByName("JOB").value = &counter;
            &JobCmp.GetPropertyByName("OPENDATE").value = &OpenDate;
            &JobCmp.GetPropertyByName("CLOSEDATE").value = &CloseDate;
            &JobCmp.GetPropertyByName("CONTACTNAME").value = &ContactName;
            &JobCmp.GetPropertyByName("CONTACTEMAIL").value = &ContactEmail;
            &JobCmp.GetPropertyByName("CONTACTPHONE").value = &ContactPhone;

            /* Check if there are interviews and we'll add these in */
            &rsInv = CreateRowset(Record.POIT_INT_CAL_VW);
            /* AND FILL.HRS_INT_DT_END >= %CurrentDate */
            &rsInv.Fill("WHERE FILL.HRS_JOB_OPENING_ID = :1 AND FILL.HRS_PERSON_ID = :2  AND FILL.HRS_INTVW_STATUS NOT IN ('X','C')", &JobID, &strPersonID);

            &intInterviewID = 0;
            &counterInt = 1;

            If &rsInv.ActiveRowCount > 0 And
                  All(&rsInv(1).GetRecord(Record.POIT_INT_CAL_VW).GetField(Field.HRS_PERSON_ID).Value) Then
               For &i = 1 To &rsInv.ActiveRowCount
                  &rcdInv = &rsInv(&i).GetRecord(Record.POIT_INT_CAL_VW);

                  /* Create new interview row */
                  &IntCmp = &IntCol.CreateItem();

                  /* Get the interview details up */
                  &IntCmp.GetPropertyByName("JOB").value = &counter;
                  &IntCmp.GetPropertyByName("JOBTITLE").value = &Title;
                  &IntCmp.GetPropertyByName("STARTDATE").value = &rcdInv.GetField(Field.HRS_INT_DT).Value;
                  &IntCmp.GetPropertyByName("STARTTIME").value = &rcdInv.GetField(Field.HRS_START_TM).Value;
                  &IntCmp.GetPropertyByName("ENDDATE").value = &rcdInv.GetField(Field.HRS_INT_DT_END).Value;
                  &IntCmp.GetPropertyByName("ENDTIME").value = &rcdInv.GetField(Field.HRS_END_TM).Value;

                  &IntCmp.GetPropertyByName("LOCATION").value = &rcdInv.GetField(Field.INTVW_LOCATION).Value;
                  &IntCmp.GetPropertyByName("STATUS").value = &rcdInv.GetField(Field.HRS_INTVW_STATUS).LongTranslateValue;
                  &IntCmp.GetPropertyByName("TIMEZONE").value = &rcdInv.GetField(Field.TIMEZONE).Value;

                  &IntCmp.GetPropertyByName("INTERVIEW").value = &counterInt;

                  /* Get all the interviewers and build up a string with their names, comma seperated */
                  &intInterviewID = &rcdInv.GetField(Field.HRS_RCM_INT_ID).Value;
                  &intRcmntID = &rcdInv.GetField(Field.HRS_RCMNT_ID).Value;

                  /* Fetch the interviewers */
                  &strInterviewers = "";
                  &rsInterviewer = CreateRowset(Record.POIT_HRS_INT_VW);
                  &rsInterviewer.Fill("WHERE FILL.HRS_PERSON_ID = :1 AND FILL.HRS_RCMNT_ID = :2 AND FILL.HRS_RCM_INT_ID = :3", &strPersonID, &intRcmntID, &intInterviewID);

                  If &rsInterviewer.ActiveRowCount > 0 Then
                     For &j = 1 To &rsInterviewer.ActiveRowCount
                        &rcdInterviewer = &rsInterviewer.GetRow(&j).GetRecord(Record.POIT_HRS_INT_VW);
                        If &strInterviewers = "" Then
                           &strInterviewers = &rcdInterviewer.GetField(Field.NAME_DISPLAY).Value;
                        Else
                           &strInterviewers = &strInterviewers | ", " | &rsInterviewer.GetRow(&j).GetRecord(Record.POIT_HRS_INT_VW).GetField(Field.NAME_DISPLAY).Value;
                        End-If;
                     End-For;
                  End-If;
                  &IntCmp.GetPropertyByName("INTERVIEWERS").value = &strInterviewers;

                  &rtn = &IntCol.InsertItem(&IntCmp, &counterInt);

                  &counterInt = &counterInt + 1;
               End-For;
            End-If;

            &rtn = &JobCol.InsertItem(&JobCmp, &counter);
            &counter = &counter + 1;
         End-For;
      End-If;

   Else
      %This.AddError("Unable to identify valid employee");
   End-If;

   /* Set the status and messages flags as necessary */
   %This.PrepareReturnPerson();
   Return %This.ResponseMsg;

end-method;

method OnError
   /+ &request as Message +/
   /+ Returns String +/
   /+ Extends/implements DTT_CHATBOT_HRS:Tools:Template.OnError +/
   Return "";
end-method;

method ValidatePerson
   /+ Returns Boolean +/

   Local boolean &chkBalance;
   Local string &chkValue, &tmpEE, &tmpCountry;

   &tmpEE = %This.PersonID;

   SQLExec("SELECT 'Y' FROM PS_HRS_APPLICANT WHERE HRS_PERSON_ID = :1", &tmpEE, &chkValue);

   If All(&chkValue) Then
      Return True;
   Else
      Return False;
   End-If;

end-method;

import PTCBAPPLSVCDEFN:ApplicationServiceBase;

class CheckApplicationsAS extends PTCBAPPLSVCDEFN:ApplicationServiceBase
   method invokeService();

   property boolean IsError;
   property string ErrorMsg;

   property string PersonID;
   property string PSAuthToken;

end-class;

method invokeService
   /+ Extends/implements PTCBAPPLSVCDEFN:ApplicationServiceBase.invokeService +/

   /* Get the token and then let us fetch the candidate data */
   %This.PSAuthToken = %AuthenticationToken;
   %This.PersonID = %EmployeeId;

   /* If we already have an Employee ID then we know that is is via internal candidate gateway
      If there is no person then we need to find it from the refrence table, keyed by the PSAUTH token*/

   If %This.PersonID = "" Then

      /* Lets get the parameter which should contain the Token ID and then use this to retrieve the appropriate data */
      Local string &strToken = %This.ServiceAPI.getInputParameter("TokenID");
      Local string &strPersonID;

      SQLExec("SELECT PERSONID FROM %TABLE(DTT_HRS_APP_ODA) WHERE GUID = :1", &strToken, &strPersonID);

      If &strPersonID = "" Then
         /* TODO - Return error response */
         %This.ServiceAPI.ResultState = "Fail";
         Return
      Else
         %This.PersonID = &strPersonID;
      End-If;
   End-If;


end-method;

import PS_PT:Integration:IRequestHandler;

class Template implements PS_PT:Integration:IRequestHandler
   method Template();

   method OnRequest(&message As Message) Returns Message abstract;
   method OnError(&request As Message) Returns string abstract;

   /* Validate Employees*/
   method ValidateEmployee() Returns boolean abstract;

   /* Manage Errors and warnings */
   method PrepareReturn();
   method PrepareReturnPerson();

   method HasErrors() Returns boolean;
   method AddError(&message As string);
   method HasWarnings() Returns boolean;
   method AddWarning(&message As string);
   method GetMessages() Returns string;

   property array of string ErrorMessages;
   property array of string WarningMessages;

   property string EmployeeID;
   property number EmployeeRcd;
   property string PersonID;
   property number PINTakeNum;
   property string Country;
   property boolean IsValid;


   property Message ResponseMsg;
   property Document ResponseDoc;
   property Compound ResponseComp;
   property Message RequestMsg;
   property Document RequestURIDoc;
   property Compound RequestComp;

   property number POITMsgSet;

end-class;

method Template
   /* Set the common items across all classes which use this super class */
   %This.ErrorMessages = CreateArrayRept("", 0);
   %This.WarningMessages = CreateArrayRept("", 0);
   /* Set the default message set number */
   %This.POITMsgSet = 32000;
end-method;

method HasErrors
   /+ Returns Boolean +/

   If %This.ErrorMessages.Len > 0 Then
      Return True;
   Else
      Return False;
   End-If;

end-method;

method HasWarnings
   /+ Returns Boolean +/

   If %This.WarningMessages.Len > 0 Then
      Return True;
   Else
      Return False;
   End-If;

end-method;


method AddError
   /+ &message as String +/

   /* Add error to list*/
   %This.ErrorMessages.Push(&message);

end-method;

method AddWarning
   /+ &message as String +/

   %This.WarningMessages.Push(&message);

end-method;

method GetMessages
   /+ Returns String +/

   Local string &returnString;
   Local number &i;

   For &i = 1 To %This.ErrorMessages.Len
      &returnString = &returnString | %This.ErrorMessages [&i] | ". ";
   End-For;

   For &i = 1 To %This.WarningMessages.Len
      &returnString = &returnString | %This.WarningMessages [&i] | ". ";
   End-For;

   rem &returnString = %This.ErrorMessages.Join(". ");
   rem &returnString = &returnString | %This.WarningMessages.Join(". ");
   Return RTrim(&returnString);
end-method;

method PrepareReturn
   /*  Check if there are errors and if so, set the status to FALSE. This will let the calling program know we have a failure 
	   We will also check set the messages in case there were forecasting warnings which need to be handled by the calling program
   */
   %This.ResponseComp.GetPropertyByName("EMPLID").value = %This.EmployeeID;

   If %This.HasErrors() Then
      %This.ResponseComp.GetPropertyByName("STATUS").value = False;
   Else
      %This.ResponseComp.GetPropertyByName("STATUS").value = True;
   End-If;
   %This.ResponseComp.GetPropertyByName("MESSAGES").value = %This.GetMessages();

end-method;

method PrepareReturnPerson
   /*  Check if there are errors and if so, set the status to FALSE. This will let the calling program know we have a failure 
	   We will also check set the messages in case there were forecasting warnings which need to be handled by the calling program
   */
   If %This.HasErrors() Then
      %This.ResponseComp.GetPropertyByName("SUCCESS").value = False;
   Else
      %This.ResponseComp.GetPropertyByName("SUCCESS").value = True;
   End-If;
   %This.ResponseComp.GetPropertyByName("MESSAGES").value = %This.GetMessages();

end-method;
